const ImageLinkForm=()=>{
    return(
       <div>
           <p className='f3'>
               {'This Magic Brain will detect face in yout picture. Give it a try'}
           </p>
           <div>
               <input className='w-70 f4 pa2' type='text'></input>
               <button className='w-30 f4 grow pa2'>Detect</button>
           </div>
       </div>
    );
}

export default ImageLinkForm;
